import {Card, Button} from "react-bootstrap";


export default function SongBox({song}){
    function handleClick() {

    }

    return (
        <>
            <Card style={{ width: '220px', minHeight: '200px' }} className="d-flex btn-outline-danger align-content-sm-start rounded-4" as={Button} onClick={()=>handleClick(song.songId)}>
                <Card.Body >
                    <Card.Title className="fs-2 text-start" >{song.title}</Card.Title>
                    <Card.Subtitle className="mb-2 font-weight-light">{song.artist_list.join(", ")}</Card.Subtitle>

                </Card.Body>
            </Card>
        </>
    )

}
